import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { 
  TrendingUp, 
  TrendingDown, 
  Play,
  MessageCircle,
  Eye,
  Clock,
  Zap,
  Target,
  Activity,
  BarChart3,
  ArrowUp,
  ArrowDown,
  Minus,
  AlertTriangle,
  Shield,

  Gauge,
  Globe,
  DollarSign,
  Users,
  Brain,
  ChevronUp,
  ChevronDown,
  Flame
} from 'lucide-react';
import { 
  tokenHeatData, 
  livestreamData, 
  xCorrelationData, 
  aiCorrelationAnalysis,
  dashboardSummary 
} from '../data/mwMonitoringData';
import { macroMarketData } from '../data/macroMarketData';
import TokenDetailPage from './TokenDetailPage';
import './MWMonitor.css';

const MWMonitor = () => {
  const [currentTime, setCurrentTime] = useState(new Date());
  const [activeSection, setActiveSection] = useState('dashboard');
  const [currentView, setCurrentView] = useState('monitor'); // 'monitor' or 'token-detail'
  const [selectedToken, setSelectedToken] = useState(null);

  useEffect(() => {
    const timer = setInterval(() => setCurrentTime(new Date()), 1000);
    return () => clearInterval(timer);
  }, []);

  const formatTime = (date) => {
    return date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  const getHeatColor = (score) => {
    if (score >= 90) return 'heat-critical';
    if (score >= 80) return 'heat-high'; 
    if (score >= 70) return 'heat-medium';
    if (score >= 60) return 'heat-warm';
    return 'heat-cool';
  };

  const getTrendIcon = (trend) => {
    switch(trend) {
      case 'rising': return <TrendingUp className="trend-rising" size={16} />;
      case 'cooling': return <TrendingDown className="trend-cooling" size={16} />;
      default: return <Activity className="trend-stable" size={16} />;
    }
  };

  // Macro Market Helper Functions
  const getRegimeIcon = (regime) => {
    switch(regime) {
      case 'PUMPING': return <ArrowUp className="regime-pumping" size={20} />;
      case 'DUMPING': return <ArrowDown className="regime-dumping" size={20} />;
      case 'RANGING': return <Minus className="regime-ranging" size={20} />;
      default: return <Activity size={20} />;
    }
  };

  const getRegimeColor = (regime) => {
    switch(regime) {
      case 'PUMPING': return '#00ff88';
      case 'DUMPING': return '#ff4444';
      case 'RANGING': return '#ffaa00';
      default: return '#ffffff';
    }
  };

  const getSentimentIcon = (signal) => {
    switch(signal) {
      case 'BULLISH': return <TrendingUp className="sentiment-bullish" size={16} />;
      case 'BEARISH': return <TrendingDown className="sentiment-bearish" size={16} />;
      case 'CAUTION': return <AlertTriangle className="sentiment-caution" size={16} />;
      default: return <Minus className="sentiment-neutral" size={16} />;
    }
  };

  const getSectorStatusColor = (status) => {
    switch(status) {
      case 'LEADING': return '#00ff88';
      case 'ROTATING': return '#0099ff';
      case 'LAGGING': return '#ffaa00';
      case 'DEAD': return '#ff4444';
      default: return '#ffffff';
    }
  };

  const formatCurrency = (value) => {
    return new Intl.NumberFormat('en-US', { 
      style: 'currency', 
      currency: 'USD',
      minimumFractionDigits: 0,
      maximumFractionDigits: 0
    }).format(value);
  };

  const handleTokenClick = (tokenSymbol) => {
    setSelectedToken(tokenSymbol);
    setCurrentView('token-detail');
  };

  const handleBackToMonitor = () => {
    setCurrentView('monitor');
    setSelectedToken(null);
    setActiveSection('dashboard');
  };

  // If we're in token detail view, render the token detail page
  if (currentView === 'token-detail' && selectedToken) {
    return (
      <TokenDetailPage 
        tokenSymbol={selectedToken}
        onBack={handleBackToMonitor}
      />
    );
  }

  return (
    <div className="mw-monitor">
      {/* Header */}
      <motion.header 
        className="monitor-header"
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
      >
        <div className="header-content">
          <div className="header-left">
            <div className="logo">
              <div className="logo-icon">ðŸ“Š</div>
              <div>
                <h1>MW Monitor</h1>
                <span>Simple Token Tracking</span>
              </div>
            </div>
            <div className="time-display">
              {formatTime(currentTime)}
            </div>
          </div>

          <div className="header-stats">
            <div className="stat">
              <span className="stat-value">{dashboardSummary.todayStats.tokensTracked}</span>
              <span className="stat-label">Tokens Tracked</span>
            </div>
            <div className="stat">
              <span className="stat-value">{dashboardSummary.todayStats.actionableSignals}</span>
              <span className="stat-label">Action Signals</span>
            </div>
            <div className="stat">
              <span className="stat-value">{dashboardSummary.todayStats.avgConfidence}%</span>
              <span className="stat-label">Avg Confidence</span>
            </div>
          </div>
        </div>
      </motion.header>

      {/* Navigation */}
      <div className="nav-tabs">
        {[
          { id: 'dashboard', label: 'ðŸŽ¯ Dashboard', count: null },
          { id: 'livestream', label: 'ðŸŽ¥ Stream Analysis', count: null },
          { id: 'xfeed', label: 'ðŸ¦ X Feed', count: xCorrelationData.length },
          { id: 'library', label: 'ðŸ“š Library', count: livestreamData.recent.length }
        ].map(tab => (
          <button
            key={tab.id}
            className={`nav-tab ${activeSection === tab.id ? 'active' : ''}`}
            onClick={() => setActiveSection(tab.id)}
          >
            {tab.label}
            {tab.count && <span className="tab-count">{tab.count}</span>}
          </button>
        ))}
      </div>

      <div className="monitor-content">

        {/* Dashboard Section */}
        {activeSection === 'dashboard' && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            className="dashboard-section"
          >
            {/* MW Macro Dashboard */}
            <motion.section 
              className="macro-dashboard"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.1 }}
            >
              {/* Market Regime Header - Most Important */}
              <div className="regime-header">
